// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import {ERC20} from "./token/ERC20.sol";
import {Ownable} from "./access/Ownable.sol";
import {IUSDC} from "./interface/IUSDC.sol";

contract USDC is ERC20, Ownable, IUSDC {
    /*////////////////////////////////////////////////////////////
                            STORAGE
    ////////////////////////////////////////////////////////////*/

    mapping(address => Balance) public mintBalance;

    /*////////////////////////////////////////////////////////////
                            CONSTRUCTOR
    ////////////////////////////////////////////////////////////*/

    constructor() ERC20("USD Coin", "USDC") {}

    /*////////////////////////////////////////////////////////////
                            LOGIC PUBLIC
    ////////////////////////////////////////////////////////////*/

    function updateMinter(address minter, uint256 limit) external onlyOwner {
        mintBalance[minter].limit = limit;
        emit UpdateMinter(minter, limit);
    }

    function mint(address to, uint256 amount) external {
        Balance storage balance = mintBalance[msg.sender];
        balance.minted += amount;
        require(balance.limit >= balance.minted);
        _mint(to, amount);
    }

    function burn(uint256 amount) external {
        mintBalance[msg.sender].minted -= amount;
        _burn(msg.sender, amount);
    }
}

interface/IUSDC.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

interface IUSDC {
    struct Balance {
        uint256 limit;
        uint256 minted;
    }

    event UpdateMinter(address indexed minter, uint256 limit);

    function updateMinter(address minter, uint256 limit) external;

    function mint(address to, uint256 amount) external;

    function burn(uint256 amount) external;
}

access/Ownable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

abstract contract Ownable {
    address public owner;

    event UpdateOwner(address indexed newOwner);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "only owner");
        _;
    }

    function updateOwner(address newOwner) external onlyOwner {
        owner = newOwner;
        emit UpdateOwner(newOwner);
    }
}

